import React from 'react';
import ScrollToBottom from 'react-scroll-to-bottom'

const TextContainer = ({ users }) => (
    <ScrollToBottom className="messages">
      {users.map((user, i) => <div key={i}>
         { user={user} }
      </div>)}
    </ScrollToBottom>
  );

  export default TextContainer;
